description:
Cần bán đất với các thông tin sau:
- Vị trí: Khu dân cư Kênh Thoát lũ, Ngô Đức Tốn (Biệt thự Đan Chi đi vào);
- Diện tích: 5x22;
- Đường trước nhà: 3m;
- Pháp lý: Sổ đỏ chính chủ, không vướng bất kỳ quy hoạch nào tại xã Phong Nẫm;
- Giá bán: 720 tr;
- Tọa độ tham khảo: X35J+627 Thành phố Phan Thiết, Bình Thuận, Việt Nam.
